import React from 'react';
import './About.css';
import Image from '/workspace/sandhyaraninarravula-react-portfolio/src/assets/5141092.jpg'; // You can replace this with your actual profile picture
import Resume from '../../assets/SandhyaRaniNarravula_Resume_2025.pdf';
import AboutBox from './AboutBox';

const About = () => {
    const downloadResume = () => {
        window.open(Resume, '_blank');
    };

    return (
        <section className="about container section" id="about">
            <h2 className="section__title">About Me</h2>

            <div className="about__container grid">
                <img src={Image} alt="Profile" className='about__img' />

                <div className="about__data grid">
                    <div className="about__info">
                        <p className="about__description">
                            Hello! I'm <strong>Sandhya Rani Narravula</strong>, a passionate Computer Science enthusiast pursuing my Master of Science in Computer Science at <strong>Stony Brook University</strong>.
                            I have a strong foundation in software development, machine learning, and artificial intelligence, with hands-on experience in deep learning, NLP, and model optimization.<br /><br />
                            My current focus is on cutting-edge AI research, particularly in neural network compression and reinforcement learning-based scheduling systems. I love tackling complex problems
                            and optimizing machine learning models for real-world applications.<br /><br />
                            Here are a few technologies Iâ€™ve been working with recently:
                        </p>
                        <ul className="about__list">
                            <li>Python</li>
                            <li>C, C++, Java</li>
                            <li>TensorFlow, PyTorch, ONNX</li>
                            <li>Machine Learning & Deep Learning</li>
                            <li>Computer Vision & NLP</li>
                            <li>AWS (EC2, S3, Lambda)</li>
                        </ul>
                        <button className="btn" onClick={downloadResume}>Download CV</button>
                    </div>
                </div>
            </div>

            <AboutBox />
        </section>
    );
};

export default About;
